    function changePage() {
        let n = (pageName === 'main' ? 'test' : 'main');
        let p = (pageName === 'main' ? <Test/> : <Main/>);
        setPage(p);
        setPageName(n);
    }

    return (
        <div>
            {page}
            <Button onClick={changePage}>test</Button>
        </div>
    )
}

export default Body;
